/* eslint-disable no-sequences */
/* eslint-disable no-unused-expressions */
import React from "react";
/*import ReactDOM from "react-dom";*/
import { BrowserRouter as Router, Routes, Route} from "react-router-dom"
import Home from "../src/pages/Home"
import About from "../src/pages/About"
import FicheLogement from "../src/pages/FicheLogement"
import Error from "../src/pages/Error"


class App extends React.Component   {
    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
          accomodations: []
        };
      }

      componentDidMount() {
          fetch("/data.json")
            .then(response => response.json())
            .then(result => {
                this.setState({
                    isLoaded:true,
                    accomodations:result,
                })
            }),error=>{
                this.setState({error})
            }}

    render()
            {
            return (
                <Router>
                <Routes>
                    <Route exact path="/" element={<Home />}/>
                    <Route exact path="/a-propos"  element={<About />}/>
                    <Route exact path="/fiche-logement/:id"  element={<FicheLogement />}/> 
                    <Route render={()=> {<Error />}}/>
                </Routes>
                </Router>
                    )
            }
}


/* L.21: "/fiche-logement/:id" permette de recuperer le parametre dans l'url de la page fiche-logement */

export default App;
